NO CONTEST plea entered to the charges in Counts 1 and 2.
Count 1, Felony Bail Jumping
Count 2, Possess Drug Paraphernalia

Rights explained.  

The Court finds the defendant freely, voluntarily enters her plea, accepts the plea, finds the defendant guilty and convicts her.
The State is recommending 18 months probation with standard conditions and AODA assessment on both counts.
The defense argues for 12 months probation on both counts.
Sentence withheld and defendant is placed on probation to DOC for 18 (eighteen) months on Count 1 and 12 (twelve) months on Count 2 to run concurrent. Court adds that defendants agent may petition for early dismissal of probation.

Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) AODA assessment and follow through;
3) Maintain absolute sobriety;
4) Submit to random urine screens and pay for same;
5) Pay court costs;
6) Pay supervision fees in an amount to be determined by DOC;
7) Provide DNA sample
